    console.log(sideList);

    function listElement () {
        let listCount = 0;
        return(
            sideList.array.forEach(element => {
                <a onClick={() => setCount(listCount)}></a>
                listCount++;
            })   
        )
    }

    return (
        <div className="left">
            {sideList}
        </div>
    )
}

